import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'; // Use Routes instead of Switch
import LoadingPage from './comp/LoadingPage';
import GlobalMap from './comp/GlobalMap';
import NavBar from './comp/NavBar'; // Import your NavBar component
import './App.css';

const App = () => {
    return (
        <Router>
            <div className="App">
                <NavBar /> {/* Add the NavBar here */}
                <Routes>
                    <Route path="/" element={<LoadingPage />} /> {/* Loading page */}
                    <Route path="/global-map" element={<GlobalMap />} /> {/* GlobalMap page */}
                </Routes>
            </div>
        </Router>
    );
};

export default App;
